import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
     monstoers: [
      {
        id: 0,
        name: 'Linda'
      },
      {
        id: 1,
        name: 'Frank'
      },
      {
        id: 2,
        name: 'Jacky'
      },
      {
        id: 3,
        name: 'Mustafa'
      }
     ],
    };
  }
  render() {
    return (
      <div className="App">
      {
        this.state.monstoers.map((monstoer) => {
          return <div key={monster.key}><h1>{monstoer.name}</h1></div>;
        })
      }
      </div>
    );
  }
}

export default App;
